`,s(t.h2,{children:"weapons selector"}),`
`,s(t.p,{children:s(t.img,{src:"/off-the-dial-site_4.png",alt:""})}),`
`,s(t.p,{children:"One of the new additions for this rewrite was a working weapon selector. No fancy tricks were really used here, but I'm really proud of the finished design."}),`
`,s(t.p,{children:["This was when I first discovered ",s(t.a,{href:"https://github.com/kentcdodds/match-sorter",children:s(t.code,{children:"match-sorter"})}),", a really cool library! Learning how to implement that into ",s(t.a,{href:"https://headlessui.com",children:s(t.code,{children:"headlessui"})}),"'s combobox was just really satsifying."]}),`
